class Local{static set(e,t){localStorage.setItem(e,JSON.stringify(t)),Local.storage_types[e]=typeof t,Local.saveStorageTypes()}static get(e){let t=JSON.parse(localStorage.getItem(e)),s=Local.storage_types[e];switch(s){case"boolean":return Boolean(t);case"number":return Number(t);case"string":return String(t);default:return t}}static getAll(){let e={};for(let t=0;t<localStorage.length;t++){let s=localStorage.key(t),a=Local.get(s);e[s]=a}return e}static delete(e){localStorage.removeItem(e),delete Local.storage_types[e],Local.saveStorageTypes()}static destroy(){localStorage.clear(),Local.storage_types={},Local.saveStorageTypes()}static saveStorageTypes(){localStorage.setItem("storage_types",JSON.stringify(Local.storage_types))}}Local.storage_types=JSON.parse(localStorage.getItem("storage_types"))||{};class Session{static set(e,t){sessionStorage.setItem(e,JSON.stringify(t)),Session.storage_types[e]=typeof t,Session.saveStorageTypes()}static get(e){let t=JSON.parse(sessionStorage.getItem(e)),s=Session.storage_types[e];switch(s){case"boolean":return Boolean(t);case"number":return Number(t);case"string":return String(t);default:return t}}static getAll(){let e={};for(let t=0;t<sessionStorage.length;t++){let s=sessionStorage.key(t),a=Session.get(s);e[s]=a}return e}static delete(e){sessionStorage.removeItem(e),delete Session.storage_types[e],Session.saveStorageTypes()}static destroy(){sessionStorage.clear(),Session.storage_types={},Session.saveStorageTypes()}static saveStorageTypes(){sessionStorage.setItem("storage_types",JSON.stringify(Session.storage_types))}}Session.storage_types=JSON.parse(sessionStorage.getItem("storage_types"))||{};